    fun String.parseCase(): Case {
        val (r1, r2, r3, r4, r5) = """#(\d+) @ (\d+),(\d+): (\d+)x(\d+)"""
                .toRegex()
                .find(this)!!
                .destructured
        return Case(r1, r2.toInt(), r3.toInt(), r4.toInt(), r5.toInt())
    }

    private fun String.toCases() = split('\n').map{ it.parseCase() }

    private fun generateFabricFor(input: String): Array<IntArray> {
        val fabric = Array(1000) { IntArray(1000) }
        input.toCases().forEach { case ->
            case.iterate { x, y ->
                fabric[x][y] = fabric[x][y] + 1
            }
        }
        return fabric
    }

    override fun solveProblem1(input: String): String {
        return generateFabricFor(input).sumBy { row ->
            row.count { inch -> inch > 1 }
        }.toString()
    }

    override fun solveProblem2(input: String): String {
        val fabric = generateFabricFor(input)
        input.toCases().forEach case@{ case ->
            case.iterate { x, y ->
                if(fabric[x][y] > 1) return@case
            }
            return@solveProblem2 case.caseNumber
        }
        return "Not Found"
    }
}.solve()

class Case(
        val caseNumber: String,
        val startX: Int,
        val startY: Int,
        val width: Int,
        val height: Int
) {
    inline fun iterate(op: (Int, Int) -> Unit) {
        (startX until startX + width).forEach { x ->
            (startY until startY + height).forEach { y ->
                op(x,y)
            }
        }
    }
}